;\n        &lt;mxCell id=\&quot;qQgtnhS6ZUklD9NuxfTn-89\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=https://d3nqfz2gm66yqg.cloudfront.net/images/20241230133956/batch-test.png;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;0.16\&quot; y=\&quot;3665.91\&quot; width=\&quot;829.84\&quot; height=\&quot;548.38\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;qQgtnhS6ZUklD9NuxfTn-93\&quot; value=\&quot;&amp;lt;blockquote style=&amp;quot;margin: 0 0 0 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;&amp;lt;b style=&amp;quot;&amp;quot;&amp;gt;Why to Test ?&amp;amp;nbsp;&amp;lt;/b&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;div style=&amp;quot;font-weight: 700; text-align: left;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 14px; font-weight: normal;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;blockquote style=&amp;quot;font-weight: 700; text-align: left; margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;Inconsistent Quality:&amp;lt;span style=&amp;quot;font-weight: normal;&amp;quot;&amp;gt;&amp;amp;nbsp;Variability in instruction data or insufficient testing can lead to unpredictable or incorrect responses.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;High Costs:&amp;lt;span style=&amp;quot;font-weight: normal;&amp;quot;&amp;gt;&amp;amp;nbsp;Poor agent performance often results in escalations or human intervention, driving up operational expenses.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Lack of Guardrails:&amp;lt;span style=&amp;quot;font-weight: normal;&amp;quot;&amp;gt;&amp;amp;nbsp;Without safeguards, agents may produce biased or irrelevant responses, which can harm trust and user experience.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Performance Limitations:&amp;lt;span style=&amp;quot;font-weight: normal;&amp;quot;&amp;gt;&amp;amp;nbsp;Agents may falter under edge cases, large-scale interactions, or specific business needs, causing reliability issues.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Slow Iteration Cycles:&amp;amp;nbsp;&amp;lt;span style=&amp;quot;font-weight: normal;&amp;quot;&amp;gt;Without proper feedback loops, agents struggle to evolve with changing business demands.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/blockquote&amp;gt;\&quot; style=\&quot;whiteSpace=wrap;html=1;fillColor=#f5f5f5;fontColor=#333333;strokeColor=#666666;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;0.16\&quot; y=\&quot;2170\&quot; width=\&quot;829.84\&quot; height=\&quot;250\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;qQgtnhS6ZUklD9NuxfTn-95\&quot; value=\&quot;&amp;lt;blockquote style=&amp;quot;margin: 0 0 0 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;font-weight: 700; text-align: left;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;How to Test ?&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;div style=&amp;quot;font-weight: 700; text-align: left;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0 0 0 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;A good quality test case dataset has three quality attributes:&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;div style=&amp;quot;font-weight: 700; text-align: left;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 14px; font-weight: normal;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;blockquote style=&amp;quot;text-align: left; margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;ul style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Volume:&amp;lt;/b&amp;gt; A sufficient number of test cases to ensure comprehensive coverage of different scenarios and edge cases.&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Diversity:&amp;lt;/b&amp;gt; A wide range of inputs, contexts, and variations to test the AI agent’s adaptability across real-world use cases.&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Quality:&amp;lt;/b&amp;gt; Well-defined, accurate, and relevant test cases aligned with the AI agent’s objectives.&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;A test case validates how the agent processes input (utterances) and generates responses. Each test case should includes:&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Utterance&amp;lt;/b&amp;gt;: Input query to the agent&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Expected Topics&amp;lt;/b&amp;gt;: Topics the agent should evaluate&amp;lt;/span&amp;gt;&amp;lt;/li&amp;g p;lt;/b&amp;gt;:&amp;lt;/span&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;Testing Center provides an innovative way to use AI to test AI, from creating a test dataset to evaluating thousands of test cases in one job to gain the confidence that the agent you build is ready to be deployed in a production environment.&amp;lt;/span&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px; background-color: transparent; color: light-dark(rgb(0, 0, 0), rgb(255, 255, 255));&amp;quot;&amp;gt;Using this will incur cost and the Einstein request consumption can be tracked in Digital Wallet&amp;lt;/span&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;i&amp;gt;Testing Center: AI-assisted evaluation&amp;lt;/i&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Topic Evaluation:&amp;lt;/b&amp;gt; Verifies the agent assessed the correct topic&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Action Evaluation&amp;lt;/b&amp;gt;: Confirms the correct actions were executed&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Outcome Evaluation:&amp;lt;/b&amp;gt; Compares expected versus actual responses using LLM-powered interpretations&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;blockquote style=&amp;quot;margin: 0px 0px 0px 40px; border: none; padding: 0px;&amp;quot;&amp;gt;&amp;lt;div&amp;gt;&amp;lt;font style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/blockquote&amp;gt;&amp;lt;div&amp;gt;&amp;lt;div style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/blockquote&amp;gt;\&quot; style=\&quot;whiteSpace=wrap;html=1;fillColor=#f5f5f5;fontColor=#333333;strokeColor=#666666;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;0.16\&quot; y=\&quot;2690\&quot; width=\&quot;830\&quot; height=\&quot;410\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;qQgtnhS6ZUklD9NuxfTn-114\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAAA6wAAAH5CAYAAACF57MpAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFxEAABcRAcom8z8AAP+lSURBVHhe7L0HdGTHdS2q/5/9bCvYkkWJYTg5D2aAQc4555xzoxuNRuhGN3LOOYfJkcNhErNIkZREKlDJspKVKFmWJUuyLduy/ez3n/3sF9b+Z1fjzjQwjQGGQaLIi7X26hvqVjh1zqmzq+pevGf3nj3QoUOHDh06dOjQoUOHDh063m7YlLDu2r37tnD3jA4dOnTo+M3Bna/W8faFuz7UoUOHDh06dKyHW8K6Z+9e7N23D/v273cL3mM6fcDVoUOHjrcPbue3db
